import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import { ArrowLeft } from 'lucide-react';

const PlansListPage = () => {
  const [plans, setPlans] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchPlans = async () => {
      try {
        const res = await fetch(`${process.env.REACT_APP_API_URL || 'http://localhost:8000'}/plans/list`);
        if (!res.ok) throw new Error('Failed to fetch plans');
        const data = await res.json();
        console.log('API Response:', data); // Debug log
        
        // Ensure data is an array
        if (Array.isArray(data)) {
          setPlans(data);
        } else if (data && Array.isArray(data.plans)) {
          setPlans(data.plans);
        } else if (data && typeof data === 'object') {
          // If it's an object, try to extract plans from it
          const plansArray = Object.values(data).find(val => Array.isArray(val));
          if (plansArray) {
            setPlans(plansArray);
          } else {
            setPlans([]);
            setError('No plans data found in response');
          }
        } else {
          setPlans([]);
          setError('Invalid response format');
        }
      } catch (err) {
        setError(err.message || 'Error fetching plans');
        setPlans([]);
      } finally {
        setLoading(false);
      }
    };
    fetchPlans();
  }, []);

  return (
    <div className="min-h-screen bg-gray-50 py-12">
      <div className="max-w-5xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="mb-8 flex items-center">
          <Link to="/" className="flex items-center text-primary-600 hover:underline">
            <ArrowLeft className="w-5 h-5 mr-2" />
            Back to Home
          </Link>
        </div>
        <div className="text-center mb-8">
          <h1 className="text-3xl font-bold text-gray-900 mb-2">All Available Plans</h1>
          <p className="text-gray-600">Browse all {plans.length} health insurance plans in our system.</p>
        </div>
        {loading ? (
          <div className="text-center py-12 text-lg text-gray-500">Loading plans...</div>
        ) : error ? (
          <div className="text-center py-12 text-red-500">{error}</div>
        ) : !Array.isArray(plans) || plans.length === 0 ? (
          <div className="text-center py-12 text-gray-500">No plans available</div>
        ) : (
          <div className="overflow-x-auto">
            <table className="min-w-full bg-white rounded-xl shadow-md">
              <thead>
                <tr>
                  <th className="px-4 py-3 text-left text-xs font-semibold text-gray-600 uppercase">Plan Name</th>
                  <th className="px-4 py-3 text-left text-xs font-semibold text-gray-600 uppercase">Carrier</th>
                  <th className="px-4 py-3 text-left text-xs font-semibold text-gray-600 uppercase">Type</th>
                  <th className="px-4 py-3 text-left text-xs font-semibold text-gray-600 uppercase">Monthly Premium</th>
                  <th className="px-4 py-3 text-left text-xs font-semibold text-gray-600 uppercase">Deductible</th>
                  <th className="px-4 py-3 text-left text-xs font-semibold text-gray-600 uppercase">Max Out of Pocket</th>
                </tr>
              </thead>
              <tbody>
                {plans.map((plan, idx) => (
                  <tr key={idx} className="border-b last:border-b-0 hover:bg-gray-50">
                    <td className="px-4 py-3 font-medium text-gray-900">{plan.name}</td>
                    <td className="px-4 py-3">{plan.company}</td>
                    <td className="px-4 py-3">{plan.type}</td>
                    <td className="px-4 py-3">${plan.monthly_premium}</td>
                    <td className="px-4 py-3">${plan.deductible}</td>
                    <td className="px-4 py-3">${plan.out_of_pocket_max}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
};

export default PlansListPage;
